    "description": "<p dir=\"ltr\" align=\"left\">Når noget forsvinder forventer man, at det kan findes igen. Sådan har Agnes det med sin mor, som er død.</p>\r\n<p dir=\"ltr\" align=\"left\">Men Agnes er ikke god til at finde noget. Ting bliver væk for hende, fugle, mennesker og virkelighedsfornemmelse. Hun leder efter alle de ting på steder, hvor de ikke er. I Berlin, i København og i Tel Aviv. </p>\r\n<p dir=\"ltr\" align=\"left\">Indtil noget umuligt en dag dukker op i hendes lejlighed. Noget, som måske kan hjælpe hende tilbage til virkeligheden.</p>\r\n<p dir=\"ltr\" align=\"left\">Forsvindingsnumre er en hudløs roman om en ung kvinde i sorg og om forsøget på at finde fodfæste i livet efter at have mistet nogen, man ikke kan undvære.</p>",
